import "./NavHome.css";
const NavHome = () => {
  return (
    <div className="navhome">
      <a className="anchor-home" href="google.com">
        <h1 className="access">AccessiLaw <p><img className='justice-img' src='images/justice.jpg' alt='justice-img'/></p></h1>
      </a>
    </div>
  );
};

export default NavHome;
